        static long arrayManipulation(int n, int[][] queries)
        {
            List<long> cache = new List<long>();
            //intialize with zeros 
            for (int index = 0; index < n; index++)
            {
                cache.Add(0);
            }

            foreach (int[] query in queries)
            {
                //gather the data make it easy to reuse. 
                int firstIndex = query[0] - 1;  //minus one because c# is zero based
                int secondIndex = query[1]; //minus one because c# is zero based but 
                //I will stop before getting here in loop
                int addIn = query[2];
                cache[firstIndex] += addIn;
                if (secondIndex < cache.Count)
                {
                    cache[secondIndex] -= addIn;
                }
            }
            for (int j = 1; j < cache.Count; j++)
            {
                cache[j] += cache[j - 1];

            }

            return cache.Max();
        }
